import React from "react";

export default class ListWidgetComponent extends React.Component {
    constructor(props) {
        super(props);

        this.state = {
            elements: false,
        }
    }

    componentDidMount() {
        const { requestUrl } = this.props;
        const url = 'http://localhost:5000' + requestUrl;
        console.log(url);
        this.setState({
            elements: true
        });
        fetch(url)
            .then(res => res.json())
            .then(result => this.setState({
                elements: result
            }));
    }

    _renderListItems() {
        let list = [];
        this.state.elements.forEach(element => {
            let lines = [];
            for (const [key, value] of Object.entries(element)) {
                if (key === '_id') {
                    console.log('yes');
                }
            }
            list.push(
                <li key={element._id}>
                    { lines }
                </li>
            )
        });

        return list;
    }

    render() {
        if (this.state.elements === false) {
            return(
                <span>Loading elements</span>
            );
        } else if (this.state.elements === true) {
            return(
                <span>Nothing found</span>
            );
        } else {
            return(
                <span>
                    {this._renderListItems()}
                </span>
            );
        }
    }
};
